import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./components/Home"; // Nuova pagina iniziale con Login e Register
import ExercisePage from "./components/ExercisePage";

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} /> {/* Pagina iniziale con login e registrazione */}
        <Route path="/exercises/:username" element={<ExercisePage />} />
      </Routes>
    </div>
  );
}

export default App;
